import React from 'react';
import CardItem from './CardItem';

function Cards() {
  return (
    <div>
      <CardItem
        Imagesrc="sugar-wise/src/Components/images/image7.jpg"
        title="Beautiful Sunset"
        text="A vibrant sunset captured over the ocean."
      />
    </div>
  );
}

export default Cards;
